import React from 'react'
import {Navbar, Nav, NavItem,Brand,Button,NavDropdown,Form,FormControl} from 'react-bootstrap';
import { BrowserRouter as Router, Switch, Route ,Link} from "react-router-dom";
import { useEffect, useState } from 'react';
import Component from "./pages/Profile" 
import SignIn from "./pages/signIn"
import BeforeLogin from "./beforeLogin"
import NavbarTitle from "./Nav/Navbar" 

const BeforeSignIn = ()=>{
    
  const [Session,setSession] = useState({
    isSignIn : false ,
  });

  return (
    <div>
       {
        Session.isSignIn ? 
        (
          <BeforeLogin />
        )  
        : 
        (
          <SignIn setSession={setSession}/> 
        )
      }
    </div>
   
  );  

}
export default BeforeSignIn;
